import React, { useState } from 'react';



const Component1 = () => {
    const[users, setUsers] = useState([])
    const callApi = async () => {
        const data = await fetch("http://localhost:3000/users");
        const result = await data.json();
        setUsers(result);
    };

    useEffect(() => {
        callApi();
    }, []);


    return (
        <div>
             <Component4 users={users} />
        </div>
    )
}

export default Component1;
